" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wet age-related macular degeneration (AMD: Fluorescein angiogram and color fundus photograph of eye with classic choroidal veovascular membrane",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 364px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal OCT (A) reveals a normal foveal thickness and contour with a small dip at the area of the foveola (arrow). Study (B) demonstrates loss of the normal anatomy, retinal edema, and a subretinal lesion consistent with a choroidal neovascular membrane (arrow). Correlation with the clinical examination and fluorescein angiogram is critical to making the correct diagnosis.",
