" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 604px\">",
"   <div class=\"ttl\">",
"    Hyperpigmentation in Addison's disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 584px; height: 414px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A 57-year-old woman presented with symptoms of primary adrenal insufficiency secondary to autoimmune Addison's disease. Diffuse skin hyerpigmentation had developed during the last year, as illustrated by her facial appearance.",
"    <br>",
"     (B) The hands demonstrate increased pigmentation of the palmar creases and wrists compared to a normal female control (far right).",
"     <br>",
"      (C) With long-term glucocorticoid and mineralocorticoid therapy, her hyperpigmentation resolved, as shown by the normal palmar skin pigmentation in the patient at age 83.",
"      <br>",
"       Of note, she wears a medical bracelet indicating her requirement for glucocorticoids in case of severe illness.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
