var title_f39_63_40953="Stage II sarcoidosis CT";
var content_f39_63_40953=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F69424%7EPULM%2F56447%7EPULM%2F79110%7EPULM%2F80035&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F69424%7EPULM%2F56447%7EPULM%2F79110%7EPULM%2F80035&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sarcoidosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 372px; height: 287px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Stage II sarcoidosis according to Siltzbach's classification. Multiple miliary peribronchiolar nodules are scattered diffusely throughout both lungs. In addition, both hilar regions are enlarged due to lymph node enlargement.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sarcoidosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 354px; height: 250px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Large, ill-defined left perihilar consolidation, unilateral left hilar enlargement, and bilateral peripheral poorly defined nodules are present. These findings are suggestive of the pseudoalveolar form of sarcoidosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Scarring in sarcoidosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 352px; height: 233px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sarcoidosis with marked scarring and parenchymal distortion in the upper lobes, bulla formation, and cavities. These changes are irreversible.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Miliary nodules in sarcoidosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 342px; height: 227px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sarcoidosis with multiple nodules, 1 to 2 mm in diameter, in peribronchiolar location. Beading of the major fissures is characteristic of lymphatic involvement. There is also prominent bilateral hilar lymph node enlargement.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
