var title_f39_63_40956="Antibiotic regimens dental";
var content_f39_63_40956=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57182&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57182&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antibiotic regimens for prophylaxis prior to dental procedures",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Situation",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Agent",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Regimen: Single dose 30 to 60 min before procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Adults",
"       </td>",
"       <td class=\"subtitle2\">",
"        Children*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oral",
"       </td>",
"       <td>",
"        Amoxicillin",
"       </td>",
"       <td>",
"        2 g",
"       </td>",
"       <td>",
"        50 mg/kg",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Unable to take oral medication",
"       </td>",
"       <td>",
"        Ampicillin",
"       </td>",
"       <td>",
"        2 g IM or IV",
"       </td>",
"       <td>",
"        50 mg/kg IM or IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cefazolin or ceftriaxone",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        1 g IM or IV",
"       </td>",
"       <td>",
"        50 mg/kg IM or IV",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"5\">",
"        Allergic to penicillins - oral",
"       </td>",
"       <td>",
"        Cephalexin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        2 g",
"       </td>",
"       <td>",
"        50 mg/kg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clindamycin",
"       </td>",
"       <td>",
"        600 mg",
"       </td>",
"       <td>",
"        20 mg/kg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Azithromycin or clarithromycin",
"       </td>",
"       <td>",
"        500 mg",
"       </td>",
"       <td>",
"        15 mg/kg",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Allergic to penicillins and unable to take oral medication",
"       </td>",
"       <td>",
"        Cefazolin or ceftriaxone",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        1 g IM or IV",
"       </td>",
"       <td>",
"        50 mg/kg IM or IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clindamycin",
"       </td>",
"       <td>",
"        600 mg IM or IV",
"       </td>",
"       <td>",
"        20 mg/kg IM or IV",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IM: intramuscular; IV: intravenous.",
"     <br>",
"      * The maximal dose in children should not exceed the dose recommended for adults.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Cephalosporins should not be used in an individual with a history of anaphylaxis, angioedema, or urticaria with penicillins.",
"       <br>",
"        &Delta; Or other first- or second-generation oral cephalosporin in equivalent adult or pediatric dose.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Wilson W, Taubert KA, Gewitz M, Lockhart PB, et al. Prevention of Infective Endocarditis. Guidelines From the American Heart Association. A Guideline From the American Heart Association Rheumatic Fever, Endocarditis, and Kawasaki Disease Committee, Council on Cardiovascular Disease in the Young, and the Council on Clinical Cardiology, Council on Cardiovascular Surgery and Anesthesia, and the Quality of Care and Outcomes Research Interdisciplinary Working Group. Circulation 2007; 116:1736. Copyright &copy; 2007 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
